import React from "react";

const RepoItem = ({ repo }) => (
  <a
    href={repo.html_url}  key={repo.id} className="repoItemContainer" target="_blank" >
   
          
    <table>
     <th border="1" border color="gray"><img class="img-thumbnail github-avatar" src="{{repo.avatar_url}}"></img></th>
      <tr>Nome </tr>
      <tr>Nome </tr>
      <tr>Nome </tr>
      <tr>Nome </tr>
      <tr>Nome </tr>
      <th>ssssssss</th>
    </table>

  </a>

);

export default RepoItem;
